select Member_ID into myMember_ID from Members where Name = myName and Surname = mySurname and ID_Passport = myID;

/*insert into  issmemember (SME_ID, Members_ID) values (myEnterprise_ID, myMember_ID);
insert into test (myTest) values (myProvince);*/

set myVisit_Date = curdate();
set myVisit_Year = year(curdate());
