DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SHG_Monthly_Visit_SP`(
IN myMonthlySHGVisit_ID	int(10),
IN mySHG_ID	int(10),
IN myEDF_ID	int(10),
IN myDate_of_Visit	date,
IN myYear	int(4),
IN myMonth	int(2),
IN mySavings	int(6),
IN myNo_Of_Loans	tinyint(3),
IN myAmount_Of_Loans	int(6),
IN myInterest	int(6),
IN myComments	varchar(255),
IN myMoney_source	varchar(20),
IN myInternal_Lend	varchar(1),
IN myRepay_Period	int(3),
IN mySHG_Phase	varchar(30),
IN myRotate_Leader	varchar(1),
IN myHow_Often_Meet	varchar(20),
IN myConflict	varchar(3),
IN myKeep_Records	varchar(1),
IN myCurrently_Save	varchar(1),
IN myReceive_Salary	varchar(1),
IN myHiH_Training	varchar(1),
IN myProvince_ID	int(3),
IN myDistrict_Metro_ID	int(3),
IN myMunicipality_ID	int(3),
IN myMain_Place_ID	int(3),
IN myWard	varchar(20),
IN myAddress1	varchar(20),
IN myAddress2	varchar(20),
IN myVillage_Suburb_ID	int(3),
IN myCity	varchar(20),
IN myPostal_Code	varchar(5),
IN myPhone	varchar(12),
IN myFax	varchar(12),
IN myGPS_Latitude	varchar(20),
IN myGPS_Longitude	varchar(20),
IN myEDF	int(10),
IN myProvince	varchar(20),
IN myDistrictMetro	varchar(20),
IN myLocalMunicipality	varchar(20),
IN myMainplace	varchar(20),
IN mySuburb	varchar(20),
IN myStatus varchar(45),
IN myContact_Person	varchar(80),
IN myBank_Account	varchar(1),
IN myHours_Per_Month	int(3))
BEGIN




/*select province_ID into myProvince_ID from province where province_name = myProvince;*/

set myVillage_Suburb_ID =1;
set myEDF_ID =1;
set myProvince_ID = 0;
set myProvince = 0;

/*if myMonthlySHGVisit_ID = 0 then*/
if myStatus = 'New' then
insert into monthlyshgvisit(
MonthlySHGVisit_ID,
SHG_ID,
EDF_ID,
Date_of_Visit,
Year,
Month,
Savings,
No_Of_Loans,
Amount_Of_Loans,
Interest,
Comments,
Money_source,
Internal_Lend,
Repay_Period,
SHG_Phase,
Rotate_Leader,
How_Often_Meet,
Conflict,
Keep_Records,
Currently_Save,
Receive_Salary,
HiH_Training,
Province_ID,
District_Metro_ID,
Municipality_ID,
Main_Place_ID,
Ward,
Address1,
Address2,
Village_Suburb_ID,
City,
Postal_Code,
Phone,
Fax,
GPS_Latitude,
GPS_Longitude,
Contact_Person,
Bank_Account,
Hours_Per_Month)
values(
myMonthlySHGVisit_ID,
mySHG_ID,
myEDF,
myDate_of_Visit,
myYear,
myMonth,
-- mySavings,
replace( replace(mySavings, ',', ''), '"', '' ),
myNo_Of_Loans,
-- myAmount_Of_Loans,
replace( replace(myAmount_of_Loans, ',', ''), '"', '' ),
-- myInterest,
replace( replace(myInterest, ',', ''), '"', '' ),
myComments,
myMoney_source,
myInternal_Lend,
myRepay_Period,
mySHG_Phase,
myRotate_Leader,
myHow_Often_Meet,
myConflict,
myKeep_Records,
myCurrently_Save,
myReceive_Salary,
myHiH_Training,
myProvince,
myDistrictMetro,
myLocalMunicipality,
myMainPlace,
myWard,
myAddress1,
myAddress2,
myVillage_Suburb_ID,
myCity,
myPostal_Code,
myPhone,
myFax,
myGPS_Latitude,
myGPS_Longitude,
myContact_Person,
myBank_Account,
myHours_Per_Month);
/*yEDF,
myProvince,
myDistrictMetro,
myLocalMunicipality,
myMainplace,
mySuburb)*/
else
update monthlyshgvisit set
SHG_ID = mySHG_ID,
EDF_ID = myEDF,
Date_of_Visit = myDate_of_Visit,
Year = myYear,
Month = myMonth,
-- Savings = mySavings,
Savings = replace( replace(mySavings, ',', ''), '"', '' ),
No_Of_Loans = myNo_Of_Loans,
-- Amount_Of_Loans = myAmount_Of_Loans,
Amount_Of_Loans = replace( replace(myAmount_of_Loans, ',', ''), '"', '' ),
-- Interest = myInterest,
Interest = replace( replace(myInterest, ',', ''), '"', '' ),
Comments = myComments,
Money_source = myMoney_source,
Internal_Lend = myInternal_Lend,
Repay_Period = myRepay_Period,
SHG_Phase = mySHG_Phase,
Rotate_Leader = myRotate_Leader,
How_Often_Meet = myHow_Often_Meet,
Conflict = myConflict,
Keep_Records = myKeep_Records,
Currently_Save = myCurrently_Save,
Receive_Salary = myReceive_Salary,
HiH_Training = myHiH_Training,
Province_ID = myProvince,
District_Metro_ID = myDistrictMetro,
Municipality_ID = myLocalMunicipality,
Main_Place_ID = myMainPlace,
Ward = myWard,
Address1 = myAddress1,
Address2 = myAddress2,
Village_Suburb_ID = myVillage_Suburb_ID,
City = myCity,
Postal_Code = myPostal_Code,
Phone = myPhone,
Fax = myFax,
GPS_Latitude = myGPS_Latitude,
GPS_Longitude = myGPS_Longitude,
Contact_Person = myContact_Person,
Bank_Account = myBank_Account,
Hours_Per_Month = myHours_Per_Month
where MonthlySHGVisit_ID = myMonthlySHGVisit_ID;
end if;
END ;;
